        public static string ConvertIntoNumeric(object number)
        {
            string str="0.00";
            if (Convert.ToDecimal(number) < 0)
            {
                str = Convert.ToDecimal(-1 * Convert.ToDecimal(number)).ToString("#,##0.00");
                str = "(" + str + ")";
            }
            else
            {
                str = Convert.ToDecimal(number).ToString("#,##0.00");
            }
            return str;
        }
